フレグランスオイルを配合してフローラルな香りとシトラスの香りをバランスよく調合。<br>柔軟剤なのに質の高い香り。香水ほど強くはないやさしい香りが長続きします。<br>2種類のマジックビーズを配合でこすると香りがはじけます♪<br><br>【香り】<br>・Top Notes：オレンジ、アップル、シトラス<br>・Mid Notes：ジャスミン、ローズ、ベリー<br>・Base Notes：バニラ、アンバー、ココナツ<br><br>【成分】<br>水、エステル型ジアルキルアンモニウム塩、グリセリン、シリコーン、香料、カチオンポリマー、ギ酸、塩化水素、シリコーン、HEDPナトリウム塩 、防腐剤、着色剤<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：P＆G<br>シリーズ名：レノア<br>内容量：480ml×3個<br><br>購入単位：1セット(3個)<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>楽天 通販 4902430638326 SK4242 sk4242 P&G p&g ぴーあんどじー ピーアンドジー ピー・アンド・ジー株式会社 ぴー・あんど・じーかぶしきがいしゃ P&G株式会社 p&g株式会社 レノア れのあ レノアハピネス れのあはぴねす はぴねす ハピネス 柔軟剤 じゅうなんざい 液体 えきたい フレグランスオイル ふれぐらんすおいる 柔軟剤以上香水未満 じゅうなんざいいじょうこうすいみまん 清潔感 せいけつかん ロイヤルリリー ろいやるりりー リリー りりー ピオニー ぴおにー フローラル ふろーらる シトラス しとらす まじっくびーず マジックビーズ</font></td></tr></table><style type="text/css">
