アロマカプセルが時間差ではじけるので、生まれたての香りを1日中楽しめる。<br>まるでアロマのヴェールをまとうように、香りであなたを包み込む。<br>奥深いアロマの香りが1日中長続き。<br>●植物生まれの柔軟成分が、センイの1本1本まで柔らかく仕上げ、静電気も防ぎます。<br>●防臭・抗菌効果で、衣類につく汗やタバコなどのイヤなニオイを抑えます。<br>※全ての菌に対して抗菌効果を有するわけではありません。<br>●天然アロマオイル配合。<br>●優雅で魅惑的な女性をイメージした香りです。<br>オリエンタルな香りをベースに、フルーティーな甘さを加えた、可愛らしさで惑わせる、小悪魔的なイメージの香り。<br><br>★トップノート：カシス、シトラス、アップル<br>★ミドルノート：ローズ、ジャスミン、バイオレット<br>★ラストノート：パチュリ、サンダル、バニラ<br><br>【成分】<br>水、エステル型ジアルキルアンモニウム塩、ポリオキシエチレンアルキルエーテル、エチルアルコール、香料、安定化剤、塩化カルシウム、BHT、防腐剤<br><br>【使用上の注意】<br>●用途外に使わないでください。<br>●乳幼児の手の届くところに置かないでください。<br>●認知症の方などの誤飲を防ぐため、置き場所に注意してください。<br>●液を直接衣類にかけないでください。<br>●液がこぼれた場合はすぐに水でふきとってください。<br><br><br>■商品詳細<br><table width=630 border=1 cellspacing=0><tr><td bgcolor=#ffffcc><p style=margin:10px;>メーカー名：ライオン<br>シリーズ名：ソフラン<br>内容量：450ml<br><br>購入単位：1個<br>配送種別：在庫品</p></td></tr></table><br><br><table width=600 border=0 cellspacing=0><tr><td><font size=1>【検索用キーワード】<br>SK5127 sk5127 4903301248545 14903301248542 ライオン らいおん LION lion ライオン株式会社 ソフラン そふらん ソフランアロマリッチ そふらんあろまりっち アロマリッチ あろまりっち 柔軟剤 じゅうなんざい 洗濯 洗たく せんたく 洗濯用品 洗たく用品 ランドリー ランドリー用品 ツメカエ 詰め替え 詰替え 詰替 つめかえ くりすてぃーぬ クリスティーヌ カシス シトラス アップル ローズ ジャスミン バイオレット パチュリ サンダル バニラ 防臭 ぼうしゅう 抗菌 こうきん</font></td></tr></table><style type="text/css">
